import React from "react";
import { Route, Switch } from "react-router";

import ToDo from "../components/ToDo.js";

export default () => {
  <Switch>
    <Route exact path="/">
      <h1>Welcome in simple ToDo app :)</h1>
    </Route>
    <Route path="/todo" component={ToDo} />
  </Switch>;
};
